@Override
public void add(BytesRef blockKey, long blockFilePointer) {
  try {
    fstBuilder.add(Util.toIntsRef(blockKey, scratchInts), blockFilePointer);
  } catch (IOException e) {
    // Should never happen.
    throw new RuntimeException(e);
  }
}

